import React from "react";
import Gondola from "./Gondola";

const Store = (props) => {
    console.log("store:__________",props.items)
    return (
        <div>
            {props.items && props.items.map((item,index) => (
                <Gondola
                    key={index}
                    gondola={item}
                />
            ))}
        </div>
    );
};
export default Store;
